import React, { useState } from 'react'
import "./portfolio.css"
import Menu from "./Menu"

const Portfolio = () => {
  const[items,setItems]= useState(Menu);
  return (
    <section className="work container section" id="work">
      <h2 className="section__title">Reecent Works</h2>
      <div className="work__filters">
        <span className="work__item">Everything</span>
        <span className="work__item">Web</span>
        <span className="work__item">App</span>
        <span className="work__item">Game</span>
        <span className="work__item">Data Analytics</span>
      </div>

      <div className="work__container grid">
      {items.map((elem)=>{
        const{id, image,title,category}= elem;
        return(
          <div className="work__card" key={id}></div>
        )
      })}
      </div>
    </section>
  )
}

export default Portfolio
